import styled from "styled-components";
import Link from "next/link";
const Container = styled.div`
  .flex;
  .justify-between;
  .px-12;
  .py-4;
  .items-center;
`;
const LogoContainer = styled.div``;
const Logo = styled.img`
  height: 100px;
`;

const MenuContainer = styled.div`
  .flex;
  .justify-between;
  .align-center;
  .w-1/2;
`;

const Menu = styled.div``;

const Header = () => {
  return (
    <Container>
      <LogoContainer>
        <Link href="/">
          <Logo src="/logo.png" alt="Vilva Athiban P B, The JS Jockey" />
        </Link>
      </LogoContainer>
      <MenuContainer>
        <Menu>About</Menu>
        <Menu>Talks</Menu>
        <Menu>Blogs</Menu>
        <Menu>Videos</Menu>
        <Menu>Projects</Menu>
        <Menu>Get in Touch</Menu>
      </MenuContainer>
    </Container>
  );
};

export default Header;
